9756269569443,\"width\":80.99173553719008,\"height\":65.29951253913889,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<h3><strong><span style=\\\"font-size:1.25em\\\">¿Qué es STEM?</span></strong></h3>\\n\\n<p><span style=\\\"font-size:1.25em\\\">STEM es un acrónimo que representa las disciplinas de Ciencia, Tecnología, Ingeniería y Matemáticas. Este concepto fue introducido a principios de los 2000 por la National Science Foundation (NSF) en Estados Unidos. Desde su origen, el enfoque STEM busca integrar estas áreas de conocimiento para promover una educación multidisciplinaria que responda a las demandas de innovación tecnológica y científica en el mercado laboral y la sociedad.</span></p>\\n\"},\"subContentId\":\"7d163013-3822-48df-a045-e27539174831\",\"metadata\":{\"contentType\":\"Texto\",\"license\":\"U\",\"title\":\"Sin título Texto\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":13.223140495867769,\"y\":48.97463440435417,\"width\":73.48874987077201,\"height\":48.69369217624054,\"action\":{\"library\":\"H5P.Image 1.1\",\"params\":{\"decorative\":true,\"contentName\":\"Imagen\",\"expandImage\":\"Expandir Imagen\",\"minimizeImage\":\"Minimizar Imagen\",\"file\":{\"path\":\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAdoAAACfCAYAAABeBhjEAAAAAXNSR0IArs4c6QAAIABJREFUeF7sfQV8XNeV/idmZmawTLIMMrMdQ+IkDnMaprbbdovbbvff7W7TdNttN9QmTVIIOHHsGGPHdswgWWxZspiZmeF/zpVHkeSRNCPNjKTRvflNZGnuu+++c9973z30HYN+apBNSkBKQEpASkBKQEpAKxIwkECrFbnKQaUEpASkBKQEpASEBCTQyhtBSkBKQEpASkBKQIsSkECrReHKoaUEpASkBKQEpAQk0Mp7QEpASkBKQEpASkCLEpBAq0XhyqGlBKQEpASkBKQEJNDKe0BKQEpASkBKQEpAixKQQKtF4cqhpQSkBKQEpASkBCTQyntASkBKQEpASkBKQIsSkECrReHKoaUEpASkBKQEpAQk0Mp7QEpASkBKQEpASkCLEpBAq0XhyqGlBKQEpASkBKQEJNDOonugv78P/fSfbFMjAQMYEBcb/59+aqExbXlfn1xfLYhW7SENDWmVaa213mjN+3nNJWW91kU96gn4sTY0FM/2aE0p0Pb29qGHPrJNrQSMaPG \",\"license\":\"U\",\"title\":\"Sin título Imagen\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"}],\"keywords\":[],\"slideBackgroundSelector\":{}},{\"elements\":[{\"x\":1.6528925619834711,\"y\":6.529951253913889,\"width\":97.52066115702479,\"height\":45.70965877739722,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<h3><span style=\\\"font-size:1.125em\\\"><strong>Características de STEM</strong></span></h3>\\n\\n<p><span style=\\\"font-size:1.125em\\\">La educación STEM se basa en un enfoque integrador en el cual cada disciplina no se aborda de forma aislada, sino que se contextualiza y relaciona con los demás. Esta metodología permite a los estudiantes desarrollar una comprensión más completa y significativa de los contenidos, conectándolos con experiencias previas y aplicándolos en contextos prácticos y relevantes. STEM fomenta un aprendizaje donde los estudiantes ven las disciplinas como herramientas para resolver problemas reales.</span></p>\\n\"},\"subContentId\":\"9b19c728-e612-4469-aa59-dbf051f4547e\",\"metadata\":{\"contentType\":\"Texto\",\"license\":\"U\",\"title\":\"Sin título Texto\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":16.528925619834713,\"y\":52.23961003131111,\"width\":71.07438016528926,\"height\":45.70965877739722,\"action\":{\"library\":\"H5P.TrueFalse 1.8\",\"params\":{\"media\":{\"disableImageZooming\":false},\"correct\":\"false\",\"behaviour\":{\"enableRetry\":true,\"enableSolutionsButton\":true,\"enableCheckButton\":true,\"confirmCheckDialog\":false,\"confirmRetryDialog\":false,\"autoCheck\":false},\"l10n\":{\"trueText\":\"Verdadero\",\"falseText\":\"Falso\",\"score\":\"Tienes @score de 66115702,\"height\":75.09443942000972,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<h3><span style=\\\"font-size:1.25em\\\"><strong>Importancia de la Educación STEM en el Siglo XXI</strong></span></h3>\\n\\n<p><span style=\\\"font-size:1.25em\\\">La relevancia de STEM ha aumentado considerablemente en el contexto actual, debido a los rápidos avances tecnológicos y la necesidad de habilidades en áreas técnicas para enfrentar desafíos globales. </span></p>\\n\\n<p><span style=\\\"font-size:1.25em\\\">Estudios señalan que la educación STEM es crucial para preparar a los estudiantes para un mercado laboral cada vez más orientado a la tecnología, además de desarrollar ciudadanos alfabetizados en ciencias que contribuyan puedan de manera informada a la sociedad. Según las estimaciones, más del 60% de los nuevos empleos en el futuro obtendrán algún grado de competencia en STEM.</span></p>\\n\"},\"subContentId\":\"c5b829be-c8be-468d-9d34-228b5bbf3e0f\",\"metadata\":{\"contentType\":\"Texto\",\"license\":\"U\",\"title\":\"Sin título Texto\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"}],\"keywords\":[],\"slideBackgroundSelector\":{}},{\"elements\":[{\"x\":1.6528925619834711,\"y\":1.3059902507827779,\"width\":97.52066115702479,\"height\":55.504585658268056,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<h3><span style=\\\"font-size:1.25em\\\"><strong>STEM como fundamento para la innovación y el desarrollo económico</strong></span></h3>\\n\\n<p><span style=\\\"font-size:1.25em\\\">STEM no solo tiene impacto en la educación, sino que también está relacionado con el desarrollo económico y la competitividad a nivel global. Las naciones que invierten en STEM tienden a estar mejor posicionadas para innovar y sostener una economía robusta. Esto convierte a STEM en un área
